import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <nav style={{marginTop:'10px'}}>
            <div to="/" style={{fontFamily: 'bookkB', marginLeft: '20px',display: 'flex', justifyContent: 'center', alignItems: 'center', fontSize:'20px'}}>
                음악을 사랑하시나요?
            </div>
        </nav>


    );
};

export default Navbar;
